抜群の拭き！取付け簡単！<br>あらゆるフロントガラスによりスムーズな拭きを実現。<br><br><br>●グラファイトコーティング<br>高品質天然ゴムを採用。ゴム先端は高精度のカット工法により、水滴を逃がさず拭き取ります。そして、ゴム表面には、グラファイトをコーティング。グラファイトは、別名、黒鉛と呼ばる炭素微粒子で、この粒子をゴム表面にコーティングすることで、ガラス面との摩擦抵抗を低減し、不快な音、ビビリのないスムーズな動きを実現。<br><br>●ワイパー形状<br>安定した払拭性能を実現するために、金属フレームを採用しています。<br><br>●替えゴム交換可能<br>クレフィットプラスは、古くなったゴムを新しいゴムに交換することができます。ゴム交換ができることで、クリアな視界を確保できるため、安全です。<br><br><br>■仕様<br>品名：CREFIT+/クレフィット プラス<br>品番：CFG55<br>メーカー：PIAA<br>サイズ：550mm<style type="text/css">
