●一般的なトーナメント式スノーワイパーと比べ、高さを約38％低くすることに成功。低くなることで空気抵抗が軽減され安定した払拭を実現。<br>
また、ウォッシャー液のケラレ減少にもつながります。製品重量においても部品点数が少ないため約45％低減しています。<br>
●フラット形状を採用することでウインドウガラスへ均一に近い接地圧力をかけることができるため安定した払拭性能を実現。<br>
●新開発のゴム断面形状と、フラットスノー本体の構造により、ワイパー作動時の衝撃を吸収し反転音を軽減。<br>
●フラットスノー本体にスポイラーを取り入れることで、高速走行時の浮き上がりを軽減。一般的なトーナメント式スノーワイパーと比べ、およそ15～20％の速度アップを実現。<br>
●雪用ワイパーで替えゴム交換ができるのはPIAAだけ！フラットスノーもゴム交換ができます。交換方法も簡単。<br>
●フラットスノーのゴムには、PIAA独自の特殊シリコンゴムを採用。ワイパーを動かすだけでウィンドウガラスに撥水被膜を形成し、雪、氷の張りつきや、早朝などの霜の凍りつきを抑制します。また、走行時前方車両からの泥ハネなども弾き、クリアな視界を得られます。<br>
●適合するワイパーアームはU字フックタイプとレクサス、トヨタ、スバル、ダイハツで新しく採用されているワイパーアームにも対応します。<br><br>



