●フレームに雪がたまったり、凍結すると払拭性能が低下するためフードでカバー<br>
さらに重く湿った雪をしっかり押しのける高剛性設計と耐寒性に優れた雪用シリコンラバーを採用<br>
●濃縮ガラコ配合。約三分ワイパーを動かすだけで撥水コート<br>
●ガラコシリーズをベストマッチ。被膜を修復し、撥水効果が長持ち<br>
●耐寒性に優れたシリコーンゴム採用。氷点下でも柔軟性を維持し、安定した拭き<br>
●雪をしっかり拭く高剛性フレーム。骨太構造で重く湿った雪も押しのけ、錆に強いステンレス製。<br><br>
